  }

  handleClick = (event) =>{
      this.setState({clickEvent:this.state.clickEvent?false:true});

  }


  handleClick = (event) =>{
    this.setState({clickEvent:true});

}



  render(){
    return(
      <div>
        {this.state.clickEventHome?<Home onClickHome={this.handleClickHome}/> :this.state.clickEvent?<Register onClick={this.handleClick}  />:<Login onClick={this.handleClick}/>}
